import React from 'react';
import Addusers from './components/Users/Addusers';
import UsersList from './components/Users/UsersList';


function App() {
  const [usersList, setUsersList] = useState([]);
  return (
    <div>
      <Addusers></Addusers>
      <UsersList user={usersList}></UsersList>

    </div>
  );
}

export default App;
